    render(){
        return(
            <header id="cabecalho">
                <div className="barra">
                        <Botao><Link to="/sobre">Ir para a página sobre \o/</Link></Botao>
                    <p>USUÁRIO LOGADO</p>
                </div> 

            </header>
        );
    }
}
